import React, { Component } from 'react'

class Exercise extends Component {
    state = { 
        title:['t1', 't2','t3'],
        genre:['g1', 'g2','g3'],
    } 
    render() { 
        return (
            <React.Fragment>
                <div className='d-inline'><p>title</p>
                <ul className=''>
                    {this.state.title.map(title => <li key ={title}>{ title }</li>)}
                </ul>
                </div>

                <div className=''><p>gener</p>
                <ul className='d-inlineBlock'>
                    {this.state.genre.map(genre => <li key ={genre}>{ genre }</li>)}
                </ul>
                </div>
            </React.Fragment>
        );
    }
}
 
export default Exercise;
